const person = {
  name: "Mosh",
  walk() {
    console.log(this);
  },
  talk() {
    setTimeout(function() {
      console.log("this", this);
    }, 1000);
  },
  talkWithSelf() {
    var self = this;
    setTimeout(function() {
      console.log("self", self);
    }, 1000);
  },
  talkWithSelfArrow() {
    setTimeout(() => {
      console.log("this", this);
    }, 1000);
  }
};

person.walk();
const walk = person.walk.bind(person);
walk();

person.talk();
person.talkWithSelf();
person.talkWithSelfArrow();

const square = number => number * number;
console.log(square(5));

const jobs = [
  { id: 1, isActive: true },
  { id: 2, isActive: true },
  { id: 3, isActive: false }
];
const activeJobs = jobs.filter(job => job.isActive);
// jobs.filter(function(job) { return job.isActive; });
console.log(activeJobs);
